def listmanager(list1):
    global possible_words
    for word in list1:
        possible_words.remove(word)
        
        
def greenbox(indexgreen, lettergreen):
    list1 = []
    for word in possible_words:
        if word[indexgreen] != lettergreen:
            list1.append(word)
    listmanager(list1)
            
            
def blackbox(letter):
    list1 = []
    for word in possible_words:
        if letter in word:
            list1.append(word)
    listmanager(list1)


def yellowbox(indexyellow, letteryellow):
    list1 = []
    for word in possible_words:
        if letteryellow not in word:
            list1.append(word)
        if word[indexyellow] == letteryellow:
            list1.append(word)
    listmanager(list1)


def distributer(wordTyped, colorCode):
    for i in range(5):
        if wordTyped[i] in commonList:
            continue
        elif colorCode[i] == 'g':
            greenbox(i, wordTyped[i])
        elif colorCode[i] == 'b':
            blackbox(wordTyped[i])
        elif colorCode[i] == 'y':
            yellowbox(i, wordTyped[i])
            

def repeatLetterWord(letter):
    list1 = []
    for word in possible_words:
        x = 0
        for let in word:
            if letter == let:
                x +=1
        if x ==2:
            list1.append(word)
    listmanager(list1)
    
    
